import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState([]);
  const [commissionOpen, setCommissionOpen] = useState(true);
  const [violationsOpen, setViolationsOpen] = useState(false);
  const [qualificationsOpen, setQualificationsOpen] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData) return <div>Loading...</div>;

  return (
    <div style={{ fontFamily: "Arial, sans-serif", backgroundColor: "#f5f5f5", minHeight: "100vh" }}>
      {/* Header */}
      <div style={{ backgroundColor: "#d32f2f", color: "white", padding: "10px 20px", display: "flex", alignItems: "center" }}>
        <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ height: "40px", marginRight: "15px" }} />
        <h2 style={{ margin: 0 }}>Agent Dashboard</h2>
        <button onClick={handleLogout} style={{ marginLeft: "auto", padding: "5px 10px", backgroundColor: "white", color: "#d32f2f", border: "none", borderRadius: "3px", cursor: "pointer" }}>Logout</button>
      </div>

      <div style={{ padding: "20px" }}>
        {/* Weekly Commission */}
        <div style={{ marginBottom: "20px", backgroundColor: "#fff", borderRadius: "5px" }}>
          <div onClick={() => setCommissionOpen(!commissionOpen)} style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", cursor: "pointer", fontWeight: "bold" }}>
            {commissionOpen ? "▼" : "▶"} Weekly Commission
          </div>
          {commissionOpen && (
            <div style={{ padding: "10px" }}>
              <table style={{ width: "100%", borderCollapse: "collapse" }}>
                <tbody>
                  <tr><td><strong>Agent Name:</strong></td><td>{commissionData.agentname || "N/A"}</td></tr>
                  <tr><td><strong>Region:</strong></td><td>{commissionData.region || "N/A"}</td></tr>
                  <tr><td><strong>NB BF:</strong></td><td>{commissionData.nbrwbf || "N/A"}</td></tr>
                  <tr><td><strong>Endo Fees:</strong></td><td>{commissionData.enfees || "N/A"}</td></tr>
                  <tr><td><strong>NB+EN Total:</strong></td><td>{commissionData.totalnben || "N/A"}</td></tr>
                </tbody>
              </table>

              <h3 style={{ marginTop: "15px" }}>Expenses</h3>
              <table style={{ width: "100%", borderCollapse: "collapse" }}>
                <tbody>
                  <tr><td><strong>Total NBs:</strong></td><td>{commissionData.totalnbs || "N/A"}</td></tr>
                  <tr><td><strong>Gross Pay:</strong></td><td>{commissionData.grosspay || "N/A"}</td></tr>
                  <tr><td><strong>NB Corp Fees:</strong></td><td>{commissionData.nbcorffee || "N/A"}</td></tr>
                  <tr><td><strong>Endo Corp Fees:</strong></td><td>{commissionData.encorpfee || "N/A"}</td></tr>
                  <tr><td><strong>Referrals/Pay Out:</strong></td><td>{commissionData.refferalspayout || "N/A"}</td></tr>
                </tbody>
              </table>

              <div style={{ marginTop: "10px" }}>
                <strong>Total Rev After Fees:</strong> {commissionData["nben(afterfees)"] || "N/A"}
                <div style={{ fontSize: "12px", color: "#555" }}>* must be $500 or more in Total Rev After Fees to qualify for COMMISSION</div>
              </div>

              <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "10px" }}>
                <tbody>
                  <tr><td><strong>Reinstatement and Renewal Fees:</strong></td><td>{commissionData.reissuerenewaltotal || "N/A"}</td></tr>
                  <tr><td><strong>Bonus Tier:</strong></td><td>{commissionData.bonustier || "N/A"}</td></tr>
                  <tr><td><strong>Bonus:</strong></td><td>{commissionData.totalbonus || "N/A"}</td></tr>
                  <tr><td><strong>Total Violations:</strong></td><td>{commissionData.totalviolations || "N/A"}</td></tr>
                  <tr><td><strong>Total Commission:</strong></td><td>{commissionData.commissionafterarfeescanningviolations || "N/A"}</td></tr>
                </tbody>
              </table>

              <button onClick={() => setQualificationsOpen(!qualificationsOpen)} style={{ marginTop: "10px", padding: "5px 10px", backgroundColor: "#d32f2f", color: "white", border: "none", borderRadius: "3px", cursor: "pointer" }}>
                {qualificationsOpen ? "Hide Commission Qualifications" : "Show Commission Qualifications"}
              </button>

              {qualificationsOpen && (
                <div style={{ marginTop: "10px", fontSize: "14px", lineHeight: "1.5" }}>
                  <h3>1. Commission Qualification</h3>
                  <ul>
                    <li>10% Commission: Agents qualify if they sell a minimum of 10 NBS.</li>
                    <li>12.5% Commission: Agents qualify if they sell a minimum of 17 NBS and achieve at least $3,500 in combined NBS & Endorsement revenue before deductions.</li>
                    <li>Minimum Qualification: After NB/RW, Endorsement, Referrals/Pay Out, and Gross Pay deductions, must have $500+ to qualify for commission for that week.</li>
                  </ul>
                  <h3>2. Revenue Calculation</h3>
                  <ul>
                    <li>Calculate Total Revenue:
                      <ul>
                        <li>NB/RW Revenue: Total from New Business (NB) and Re-WRITES (RW).</li>
                        <li>Endorsement Revenue: Total from endorsements.</li>
                        <li>Combine Revenues: Add NB/RW and Endorsement Revenues together.</li>
                      </ul>
                    </li>
                    <li>Apply Deductions:
                      <ul>
                        <li>NB Sales Deduction: Deduct $20 per NB sold.</li>
                        <li>Endorsement Fee: Deduct 20% of Endorsement Revenue.</li>
                        <li>Referrals/Pay Out: Referral pay outs get deducted from total revenue.</li>
                        <li>Gross Pay Deduction: Deduct agent’s gross pay.</li>
                      </ul>
                    </li>
                    <li>After deductions, revenue must be $500+ to qualify for commission for that week.</li>
                    <li>Re-Issues & Renewals: Deduct 20% Corp charge and add remaining to final revenue.</li>
                  </ul>
                  <h3>3. Commission Calculation</h3>
                  <ul>
                    <li>Determine Commission Rate:
                      <ul>
                        <li>10%: At least 10 NBS sold but not qualifying for 12.5%.</li>
                        <li>12.5%: 17 NBS sold and $3,500+ combined revenue before deductions.</li>
                      </ul>
                    </li>
                    <li>Calculate Commission: Multiply final revenue after deductions by applicable rate.</li>
                  </ul>
                  <h3>4. Adjustments</h3>
                  <ul>
                    <li>AR Fees & Scanning Violations: Deducted from final commission. If agent does not make commission, fees carry over to next week.</li>
                  </ul>
                </div>
              )}
            </div>
          )}
        </div>

        {/* Violations */}
        <div style={{ backgroundColor: "#fff", borderRadius: "5px" }}>
          <div onClick={() => setViolationsOpen(!violationsOpen)} style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", cursor: "pointer", fontWeight: "bold" }}>
            {violationsOpen ? "▼" : "▶"} Scanning Violations & ARs
          </div>
          {violationsOpen && (
            <div style={{ padding: "10px" }}>
              {violationsData.length === 0 ? (
                <div>No violations found.</div>
              ) : (
                violationsData.map((violation, index) => (
                  <div key={index} style={{ marginBottom: "10px", borderBottom: "1px solid #ccc", paddingBottom: "5px" }}>
                    {Object.entries(violation).map(([key, value]) => (
                      <div key={key}><strong>{key}:</strong> {value || "N/A"}</div>
                    ))}
                  </div>
                ))
              )}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
